import React from "react";
import Button from "./Button";


const Card = (props) => {


    return (

        <div className={"card"} style={{ width: "18rem" }}>
            <img src={props.image} className={"card image"} alt={"Picture of a cat"} />
            <div className={"card-body"}>
                <h5 className={"card title"}>Card title</h5>
                <p className={"card paragraph"}>Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <div>
                    <Button buttonName={"Boka"} buttonType={"card"} />
                </div>
            </div>
        </div>

    )
}

export default Card;
